import React from "react";
import { useNavigate } from "react-router-dom";

const Deconnect = () => {
  const navigate = useNavigate();
  const handleClick = () => {
    localStorage.clear();
    navigate("/login");
  };
  return (
    <button
      onClick={handleClick}
      class="bg-[blue] hover:bg-blue-700 text-white m-3 font-bold py-1 px-2 rounded "
    >
      Log out
    </button>
  );
};

export default Deconnect;
